INSERT INTO `fr_message` VALUES ('1', '中关村 东南小区精装主卧', '房子精装修，正规的1室，拎包入住，房子里面整洁干净,家具家电齐全，家具家电新，省时省力，居住方便。\r\n\r\n \r\n\r\n小区环境整洁干净，24小时保安巡逻，安全有保证。毗邻公园，环境超级好，天然的氧吧。\r\n\r\n \r\n\r\n交通方便，省去您的出行麻烦。\r\n周围商店：保福商场、超市发菜市场、赛乐佳平价超市、大食代云贵印象、一茶一坐(中关村店)，餐饮：他她湘菜、桃酥王-中关村店、京成惠食佳食府、当当餐饮、民秋月餐厅、黑客餐厅、维乐德式餐吧、盛乐园BBQ、京福餐厅、老姚餐厅，，购物方便，居家生活便利。\r\n\r\n \r\n\r\n欢迎您来电咨询看房，有租房的朋友赶快来电吧！！！', '2014-11-19', '0', '1', '1', '1', '0', '1'), ('2', '【优质房】国贸双井 CBD', '房屋优势：租金便宜：业主很好说话，只要租户稳定，价钱在议。\r\n户型介绍：南北通透三居，两个卫生间，全明格局，位于中高层，采光很好，无遮挡，可观小区花园。看着整个小区的绿色花园，心情肯定不错。卧室和客厅的窗户很大，里面很明亮。厨房里面有一个小阳台，可以放一些日常杂物。家具家电齐全，拎包即可入住\r\n其它介绍：专5路、特8、特8快、300、300快，107、99、735、28,、684等等多路公交。\r\n地铁：1号线、10号线、即将开通的7号线。\r\n小区介绍：富力城的环境非常的幽美，绿化率高达47%。绿化面积大，中式园\r\n林风、欧式建筑尽显其中，每天下班回来，漫步在清幽的小路上，会洗去您一天\r\n的疲乏，悠然阔达是它送您的礼物。\r\n其他优势：这里有您想要的房源，我们会为您提供一站式服务，依最热情最周到的服', '2014-11-25', '0', '1', '1', '1', '0', '1'), ('3', 'baby庆26岁生日', '生日快乐', '2015-03-01', '0', '1', '2', '2', '0', '1'), ('4', '有想在天津发展的做Android的朋友吗？', '降息', '2015-03-01', '0', '1', '3', '2', '0', '1'), ('5', '手机访问wap网站自动跳转到WWW站点', '咋骗', '2015-04-02', '0', '1', '1', '3', '0', '1'), ('6', '第四届全国文明城市', '有济源市，哈哈', '2015-03-25', '0', '1', '2', '4', '0', '1'), ('7', 'OC新人进', 'OC新人进', '2014-11-25', '0', '1', '3', '1', '0', '1'), ('8', '全新的三星开发者论坛官网---‘Samsung Developers’ 开放', '2011年1月27日- 三星电子作为移动设备提供领域的领军者，在1月27日正式开放了- “三星开发者 \r\n\r\n论坛”，您可以通过下面的URL进行访问：http://developer.samsung.com \r\n\r\n\r\n    为连接设备开发应用，对于个人和大公司来说已经是一个极具吸引力的项目。借由三星的硬件，应 \r\n\r\n用开发人员不仅增加想象的空间，同时还可以和数以百万计的开发者交流。 \r\n\r\n\r\n    在任何时候，对于一个为多平台和多设备开发的应用而言，融合是必须的。软件作为一种基于互联 \r\n\r\n网的服务向传统的分布式方法发起了挑战，而人们也正期待着这样的软件能运行在2010年推出的高端设备上。云计算已经完美的融入到数百万用户的数字生活当中，而且正朝着越来越令人振奋方向发展。而能帮助您渡过这个过度时期，把您的想法变为现实的就是三星开发者论坛。 \r\n\r\n\r\n    三星开发者论坛提供了一个新的场所，要为使用三星智能设备的开发者提供最新的新闻资讯，要以丰富的内容和活跃的论坛来提供技术建议和支持。三星开发者论坛将为三星当前发布的所有平台提供一个单一的综合门户，包含最新的SDK、教程视频以及硬件和软件的更新。 \r\n\r\n    如果您想做开发，但又不知道第一步该做什么，为什么不来看看我们的“入门指南”呢？不论您使 \r\n\r\n用的平台或者目标设备是什么，这个对于开发过程的高层次的综述将会帮助您构建您的应用，并把您的 \r\n\r\n应用投放到市场中。三星开发者论坛将会持续不断的丰富“入门指南”，确保您尽可能简单高效的完成您的开发项目。 ', '2015-03-0